import React from "react";
import "./patient.css";

const Patient = () => {
    return (
        <div class="patientContainer">
            <div class="patientContainer_Left">
                <button class="btn btn_Left">Consult Doctor</button>
            </div>
            <div class="patientContainer_right">
                <button class="btn btn_Right">Alternate Medicine</button>
            </div>
        </div>
    );
};

export default Patient;
